INSERT INTO `jobNotes` VALUES (2,'willisjo','2006-07-12 01:31:27','test',3,'Save Note'),(3,'','0000-00-00 00:00:00','oh john is great!!!!',0,'Save Note'),(4,'willisjo','2006-07-12 01:32:42','aasdfasdf',3,'Save Note'),(5,'anthony','2006-07-12 01:32:41','poop',3,'Save Note'),(6,'willisjo','2006-07-12 01:37:06','fsdf',3,'Save Note'),(7,'anthony','2006-07-12 08:27:40','Loren what do you think about this web site stuff?!!!',13,'Save Note'),(8,'loren','2006-07-12 08:29:36','',13,'Save Note'),(9,'loren','2006-07-12 08:29:38','This is great stuff!!',13,'Save Note'),(10,'anthony','2006-07-12 12:17:17','I have changed the status of this job-Anthony',11,'Save Note'),(11,'richard','2006-07-25 15:07:36','1.  Schedule B Title Exception Notes should state whether or not they affect the property.  In addition, exception numbers 6,8,13-17, 21,22, 25,26, 28, 29, 31, 32, and 34 are not listed on the survey.  All the easements and exceptions should be plotted on the survey drawing, or indicated that they are blanket in nature.\r\n \r\n2.  The following lines of the surveyed legal description don\'t match the survey drawing:  5, 8, 9, 26, 33, 40, 41, 42, 45, 54, 68,69,  70, 73.\r\n \r\n3.  Please use the certification with 2005 Table A items.\r\n \r\n4.  Show the POB on the survey drawing.\r\n \r\n5.  Show Superstition Springs Blvd. on the drawing.\r\n \r\n6.  Certified parties are:\r\n \r\nU.S. Bank National Association, as Corporate Indenture Trustee\r\nTodd DiNezza, as Co-Indenture Trustee\r\nRetail Trust III, a Delaware statutory trust\r\nWal-Mart Stores, Inc., a Delaware corporation\r\nWal-Mart Realty Company, an Arkansas corporation\r\n \r\nThe lender may have additional comments, but if we can get these changes made and prints sent out, perhaps they won\'t require many more revisions.',12,'Save Note'),(12,'anthony','2006-07-26 11:36:25','John mt email wasnt workin because of a problem with verozon.  Its taken care of so I posted this here and Im sending it again to your email.  Call me!!!',20,'Save Note'),(13,'','2006-08-24 15:55:30','Do we need a Lot and Block description',36,'Save Note'),(14,'anthony','2006-10-31 10:00:01','Bill,\r\nThis job still has about for more field days before completeion.  One of my party chiefs and I discussed double teaming the rest of the survey at te end of this week.\r\nThanks,\r\n\r\nAnthony',66,'Save Note'),(15,'anthony','2006-11-03 11:00:10','Sorry for the late delivery!!!',79,'Save Note'),(16,'anthony','2006-11-12 23:59:00','John,\r\nI wanted you to know I really apreciate everything you\'ve done to help me and my company succeed.  I will always remeber this!\r\n\r\nAnthony',85,'Save Note'),(17,'willisjo','2006-11-13 04:47:41','test',84,'Save Note'),(18,'james','2007-01-20 16:01:49','Bill,\r\nAll data is complete for this project.  If you have any other additional needs please do not hesitate to let me know ASAP.  Also, I apologize about the later delivery of this last chunk of data.  It has been complete since 1-15-06 and Failed to upload it.  If this has hurt the project in anyway I would be happy to address the matter, and make appropriate compensation.  That being said, I hope that this new year is going excellent for you and Smith Engineering.  We still need to shoot coordinates on the Brass cap at the ponds.  Just let me know when and we\'ll get up there.\r\nThanks,\r\n\r\nAnthony',66,'Save Note'),(19,'willisjo','2009-01-16 11:10:11','Poop on my life',44,'Save Note');
