INSERT INTO `messageInbox` VALUES (11,1,2,'Site Updates','Several updates have been rolled out tonight:\r\n\r\n-Date problems on customer orders are now fixed\r\n-New page for adding companies (allows entry of company name and address)\r\n-New page for editing existing companies (Account Tools/Manage Companies), also allows you to view accounts associated with each company\r\n-The mail viewer now works, although there is not yet a reply or forward feature\r\n\r\nThe groundwork has been put into place for a whole new notification architecture. I have some pages in work that will allow you fine-grained control over who within a company receives notifications for which jobs, who at CLS gets notified when an order is placed or a message is received, etc. The new notification system will also support Verizon SMS text messaging for notifications. This also applies to the customer side.\r\n\r\nHope this helps,\r\n\r\nJohn','2006-12-11 02:08:58','yes',10,0),(12,2,6,'John says about website','From:  	John Willis\r\nSubject: 	Site Updates\r\nSent: 	12/11/2006\r\nRef. Job No.: 	Job No. 023-060608\r\n\r\nSeveral updates have been rolled out tonight:\r\n\r\n-Date problems on customer orders are now fixed\r\n-New page for adding companies (allows entry of company name and address)\r\n-New page for editing existing companies (Account Tools/Manage Companies), also allows you to view accounts associated with each company\r\n-The mail viewer now works, although there is not yet a reply or forward feature\r\n\r\nThe groundwork has been put into place for a whole new notification architecture. I have some pages in work that will allow you fine-grained control over who within a company receives notifications for which jobs, who at CLS gets notified when an order is placed or a message is received, etc. The new notification system will also support Verizon SMS text messaging for notifications. This also applies to the customer side.\r\n\r\nHope this helps,\r\n\r\nJohn\r\n\r\n','2006-12-11 08:25:03','yes',3,0),(13,2,6,'Hello','Thanks got your note','2006-12-12 11:24:03','yes',119,0),(14,1,2,'yo','wazzup','2007-04-13 16:09:07','yes',10,0),(15,1,2,'Software project tracking','Working on the actual user interface for time cards. I remember we had discussed an item you needed to enter on that project. Can you do this for me?\r\n\r\nhttp://www.clogic-int.com/SoftwareProjects/ViewProject.cfm?id=7\r\n\r\nthanks,\r\njohn','2007-05-09 09:15:00','yes',10,0),(16,2,1,'New Project Entry','John,\r\nOn the Software tracking site I accidentally named a new project \"Anthony Gutierrez\".  Can you please change this to \"Add New Project\".\r\nThanks,\r\n\r\nAG','2007-05-17 00:44:40','yes',48,0),(17,1,2,'Task code categorization','Would there be an easy way to sort the task codes into categories? i.e. the employee selects e.g. \"Survey\" or \"Administration\" and then selects an appropriate task code from within those categories? It seems possible to me, but as I\'m not entirely familiar with the way our task codes are set up, I wanted to check with you.\r\n\r\nThanks,\r\nJW','2007-05-17 12:18:27','yes',48,0),(18,2,1,'Some Changes i thought of','John,\r\nI though of something while trying to think of how the site will calculate profit and loss for us.\r\n\r\n1. We shoul be able to, upon acceptance of the job, specify whether or not it is a \"Time and Materials\" job, a \"Lump Sum\" job (which an amount would be entered by loren, or a \"Cost Estimate\" in which case an amount would be enetered and the site would notify us when we\'ve reached 3/4 of the total amount.  \"Time and Materials\" and \"Cost Estimate\" thus way all jobs would use normal task codes, but for the \"Lump Sum\" the site would know that because of the job type selection it would apply the charges as a deduction instead of a cumulative addition of task codes.\r\n2. Using the above principle, an employee doesnt build the charge for a job based on task codes, the job does based on the selection of job type then task codes, kindof a hierarchy.\r\n3. Addition of Job Expenses as a line entry in the time card.  These expenses would act just like task codes, and there is a task code for expenses, the only thing that differs is that the employee enters the amount of the expense instead of the task code entering for him/her.\r\n4. Using all this together I want the site to give me daily statistics.  ONe being a line graph of our profit charted by day/month or month/year or day/year.  The low margin being the lowest profit day and the high margin being the highest profit day.  I also want tit to tell me which employee is making the most money for me, which one is making the least, and what the average total time it takes to complete \"metes and bounds\" and \"lot and block\" surveys seperately, differentiating between Field hours and CAD/office hours.\r\n\r\nLet me know what you think.\r\nThanks,\r\n\r\nAG','2007-06-08 16:59:21','yes',3,0),(19,2,1,'John Esquibel Text','John F. Esquibel\r\nSurveyor of Record\r\nNMPS No. 5949\r\n\r\nBeing born and raised in Las Cruces, John takes great care and pride in the work we distribute to our community.  John graduated with an Engineering degree from New Mexico State University.  One of his first post-graduation jobs was working as a survey party chief in Los Angeles, California.  It was at this time he fell in love with surveying.  He found surveying fit his character, his love for precision, his care for practice and his need for hands-on application.  John now leads the survey teams at Center Line Services, LLC and is continually challenging him self and our staff to always be a more than a step ahead of our competition by providing service, care and precision in all we do.  John is also a Registered Professional Surveyor in Arizona and Colorado.','2007-06-11 02:42:35','yes',48,0),(20,54,54,'test','hey','2007-06-11 11:53:27','yes',10,0),(21,54,2,'Job Numbers','The Job Numbers are not here ','2007-06-11 14:02:09','yes',10,0),(22,2,1,'Just some ideas for the future','I thought I would jot down some ideas as I was thinking about them.\r\n\r\n1. Project number component that could automatically assign new project numbers and cross check for valid entry of project numbers, like when entered in time sheets.\r\n\r\n2.  also found this site that seemed to have a lot of free info for developers who want their stuff to work on cell phones http://www.devx.com/wireless/Door/11235\r\n\r\n3. I would like my brother in law, Jason, to meet with us some time and talk to us about the accounting side, what he would like to see his clients have in something like our software as far as accounting goes.  Like where a good place to stop the accounting power would be.  And if we should have an accountants level access and features.  Anyway he seems to be up with the modern stuff as far as accounting software goes.  One of the other reasons I want to look into it now is that it may decrease our work significantly on the reporting side, money figures and what have you.\r\n\r\nPEACE!!!!','2007-06-12 07:30:25','yes',48,0),(23,1,1,'test','test','2007-06-13 20:46:21','yes',10,0),(24,2,57,'New Task Codes Created for Your Tasks!!!!!','Hey Molly,\r\nI created some new codes for adding line items to your Time sheets.\r\n46 is for document scanning\r\n47 Personnel Data for Photos and other personnel related items.\r\nPeace out,\r\n\r\nAnthony','2007-06-14 21:09:42','yes',48,0),(25,2,8,'Bad time entry on Log sheet','Hey dude,\r\nyou entered this line on your time sheet for this job:\r\n\r\n 43  	TAKE TRUCK TO CHECK O2 SENSOR  	N/A  	0  	0  	0  	1.0\r\n\r\nput this on a new time sheet.  If you leave it on that job it messes up the expenses on that job and it wont balance right.  Anything you do that doesn\'t apply to a certain job needs to be posted to either ADMIN or something else.\r\n\r\nPeace,\r\n\r\nAnthony','2007-06-19 09:04:30','yes',217,0),(26,6,72,'Legal Description','Sharon:\r\n\r\nDo you have any legal description for the project at 121 Stallion Rd, La Mesa ?\r\n\r\nLoren','2007-07-07 17:25:47','no',255,0),(27,6,51,'Need name of subdivision','Rachel:\r\n\r\nCan you give us the subdivision for the Smith to Ferris survey?\r\n\r\nLoren','2007-07-07 17:28:31','no',247,0),(28,1,6,'project numbers','Loren,\r\n\r\nPutting in fake project numbers like this crashes the system. Project numbers must conform to the XXX-XXXXXX format.\r\n\r\nJohn','2007-07-09 16:51:22','yes',255,0),(29,1,2,'HI ANCHO','aksjhdkjkajsnd','2007-07-16 15:38:54','yes',173,0),(30,1,2,'kjbkajbkvb','alknlnmk','2007-07-16 15:39:57','yes',173,0),(31,1,1,'test','test','2007-07-20 09:38:20','yes',173,0),(32,1,1,'test','test','2007-07-20 09:54:02','yes',173,0),(33,1,1,'Just a quick message','You rock.','2007-07-22 23:09:14','yes',173,0),(34,1,2,'Test','Test','2007-07-23 10:21:11','yes',173,0),(35,2,1,'YO','Thanks for the detailed message.  ASS!','2007-07-23 10:22:27','yes',173,0),(36,1,2,'test','test','2007-07-23 10:29:38','yes',173,0),(37,1,2,'test','no problem, butt.','2007-07-23 10:39:04','yes',173,0),(38,83,83,'Message Test','Hi myself!','2007-07-23 12:25:33','yes',173,0),(39,2,6,'Invoice amount','Loren,\nPlease make the invoice for job 317-07 for $700.00 plus NMGRT.  We are doing the boundary plat and then the improvement survey when the home is built.\nThanks,\n\nAnthony','2007-07-24 20:17:11','yes',275,0),(40,1,2,'la','Dont you ever sign on!!!','2007-07-24 22:08:21','yes',173,0),(41,1,2,'HEY','BUCK FY HUTT, MARD!!!!','2007-07-26 02:43:15','yes',173,0),(42,1,2,'bwarrhhh!','pop a squaw? eat a poop?','2007-07-26 17:13:18','yes',173,0),(43,1,1,'test','test','2007-07-26 23:48:51','yes',173,0),(44,1,1,'test','test','2007-07-26 23:49:38','yes',173,0),(45,1,2,'Hey dude','wazzup','2007-07-26 23:50:15','yes',173,0),(46,1,1,'test','test','2007-07-29 10:20:01','yes',NULL,0),(47,1,1,'test','test','2007-07-29 17:49:05','yes',NULL,0),(48,1,1,'test','test','2007-07-29 18:08:19','yes',NULL,0),(49,2,3,'Hey Buddy','What op peace outness!!!!!','2007-07-29 23:46:33','yes',NULL,0),(50,3,1,'Mail is cool!!!!!','Sweet Dude!!!! The mail works great!!!!!','2007-07-29 23:48:04','yes',NULL,0),(51,1,1,'test','test','2007-07-30 00:50:58','yes',NULL,0),(52,1,1,'test','test','2007-07-30 00:51:59','yes',NULL,0),(53,1,2,'hi','asdf','2007-07-30 09:21:39','yes',NULL,0),(54,1,1,'test','test','2007-07-30 09:38:04','yes',NULL,1),(55,1,1,'test','test','2007-07-30 09:39:41','yes',NULL,1),(56,1,1,'test','test','2007-07-30 09:40:13','yes',NULL,1),(57,1,1,'Read Receipt - test','Your message to John Willis was read on 07/30/2007 at 9:40 AM','2007-07-30 09:40:47','yes',NULL,0),(58,1,1,'test','test','2007-07-30 09:41:42','yes',NULL,0),(59,1,1,'test','test','2007-07-30 09:41:57','yes',NULL,0),(60,1,1,'test','test','2007-07-30 09:42:21','yes',NULL,0),(61,2,1,'poo','poo','2007-07-30 09:47:44','yes',NULL,1),(62,1,2,'Read Receipt - poo','Your message to Anthony Gutierrez was read on 07/30/2007 at 9:47 AM','2007-07-30 09:47:54','yes',NULL,0),(63,1,73,'Text messaging setup','Hey Christian,\n\nYou should set your account up for text messaging. Go to \"Edit My Profile\" under the Accounts menu, click \"Change basic information\", scroll down, and click \"Configure my account for text messaging\". You will receive a confirmation text, to which you will need to reply with the code provided.\n\nJohn','2007-07-30 10:01:20','yes',NULL,1),(64,1,2,'La!','When I told my mother the news, she tried to shrug it off--My daughter, the jet-setter--but I could tell that she was upset by the way she was violently chopping vegetables for dinner. Speaking of heinous skankitude, look what I found. \"How does she know?\" said Manda, through clenched teeth, looking at Sara because she already new the answer. I need a skin graft, my lips are permanently damaged from the amount of ass-kissing I did today. He\'s the most persistent of my European suitors, the one I\'ve nicknamed \"Woody\" for reasons that I don\'t want or need to explain. \"Jess, that\'s so, like, unprofessional.\" He apologized with that grin of his, pressing one hand into the small of my back and the other on my waist to \"steady\" himself. Why do you always have to step in where you\'re not wanted?','2007-07-30 14:36:03','yes',NULL,1),(65,2,1,'Read Receipt - La!','Your message was read on 07/30/2007 at 2:39 PM','2007-07-30 14:39:29','yes',NULL,0),(66,2,24,'This is Mail','what up?','2007-07-31 12:17:46','yes',NULL,0),(67,2,82,'How do you like the mail feature?','Testing inner site mail.','2007-07-31 14:45:47','no',NULL,0),(68,73,1,'Read Receipt - Text messaging setup','Your message was read on 07/31/2007 at 6:49 PM','2007-07-31 18:49:50','yes',NULL,0),(69,1,2,'test','test','2015-12-04 23:37:04','yes',173,0),(70,1,2,'test','test','2018-06-06 20:09:14','yes',18,0),(71,1,1,'test','test','2018-06-06 20:09:58','yes',NULL,0);
