INSERT INTO `news_items` VALUES (1,'Priority projects view','Now shows due dates in yellow when 2 days out or less.','2007-07-03 00:00:00',0),(19,'Order Processing','New order processing and approval system has been launched for WebWare.','2007-07-06 00:00:00',0),(23,'User profiles coming soon to WebWare!','Coming soon.  When you log in or receive notifications via email, you will know who processed your order, who worked on your project, and who sent your final invoice.  Now your order will be personalized from start to finish.','2007-07-06 00:00:00',0),(24,'New order placed','Center Line Services, Inc. will be providing construction layout for The Lordsburg Municipal Airport Improvement Project.  Project include a 200 feet extension to runway 12/30 as well as 1500 feet of  taxiway additions.','2007-07-18 17:32:20',0),(25,'WebWare.CL now running on client side!!!','We have made a very useful update to the client side system.  Clients have a completely new project viewing system.  With the following add-ons:\n\n-Side Bar Application Browser.\n-The ability to search previously requested projects.\n-The Home View now sorts jobs by due date order and does not display completed jobs.\n-Fully viewable maps by Google.\n-File Upload Capabilities.\n-Edit your Profile.\n*Please set your screen resolution to a minimum of 1024 X 768.\n*WebWare.CL is optimized for Mozilla Firefox.','2007-07-20 00:00:00',0),(26,'New order placed',' Southwestern Abstract & Title ordered a Improvement Survey - Lot & Block','2007-07-27 17:30:41',0),(27,'New order placed',' Southwestern Abstract & Title ordered a Improvement Survey - Lot & Block','2007-07-30 11:15:31',0),(28,'New order placed',' Southwestern Abstract & Title ordered a Plat of Survey','2007-07-30 11:16:12',0),(29,'CLS Starts Layout','Layout of the Lordsburg Municipal Airport improvements will begin August 1, 2007 for AUI, Inc.','2007-07-31 00:00:00',0),(30,'Thank You!!!','We would like to extend a big THANK YOU to Southwestern Abstract and Title of Las Cruces!  You made July 30 the day with the most orders placed through our online ordering system.  Your business means a lot to us.\nThank you again!\n\nAnthony Gutierrez\nPresident & CEO','2007-07-31 00:00:00',0),(31,'New order placed',' Southwestern Abstract & Title ordered a Improvement Survey - Lot & Block','2007-08-02 12:26:25',0),(32,'New order placed','\n\nSierra Title ordered a Plat of Survey','2018-06-06 17:21:23',0),(33,'WebWare.CL Now Modernized','WebWare.CL has been modernized! Using the Twitter Bootstrap responsive UI framework and modern HTML5 code, this clunky old app now does things in modern browsers! Woo!','2018-06-08 00:00:00',0);
